export default function Signup() {
    return (
        <div className="flex justify-center h-[32rem]">
            {/*IMAGE*/}
            <div className="">
                <img className="h-full" alt="" src="../static/img/signup.png"/>
            </div>

            {/*SIGNUP FORM*/}
            <div className="font-['Work_Sans']">
                <p className="text-white text-5xl  font-bold">Create Account</p>
                <p className="">Welcome! Enter Your Details And Experience Graphical Password System.</p>

            </div>
        </div>
    )
}
